insert  into `vc_videos`(`v_id`,`v_user_id`,`v_cat_id`,`v_title`,`v_link`,`v_thumb_image`,`v_desc`,`type_of_video`,`v_state`,`created_at`,`updated_at`,`browsed_video`,`browsed_imagecode`) values (14,9,58,'Tamasha | Official Trailer | Deepika Padukone, Ranbir Kapoor | In Cinemas Nov 27 ','https://www.youtube.com/watch?v=VN_qxutU_qc','default.jpg','Published on Sep 22, 2015\r\n\r\nUTV Motion Pictures & Nadiadwala Grandson Entertainment Pvt. Ltd. present Tamasha starring Ranbir Kapoor and Deepika Padukone. The film is directed by Imtiaz Ali and produced by Sajid Nadiadwala releases on November 27.','normal',1,'2015-09-25 08:27:18',NULL,NULL,NULL),(15,9,58,'Puli - Official Trailer 2 | Vijay, Sridevi, Sudeep, Shruti Haasan, Hansika Motwani ','https://www.youtube.com/watch?v=DQdHf1pzGqc','default.jpg','Everyone is entitled to their own opinion. But I don\'t understand two things from Tamil people. One why is it so important for people to abuse a popular actor? I understand people have their favourites, but even around the world, for example in Hollywood, I may like Robert Downey Jr., but that doesn\'t mean I won\'t appreciate any other actors work. Even if it isn\'t my favourite actor I still try to be positive and enjoy the film. From where I see this movie, it is a step forward for Tamil cinema. Another thing I don\'t understand is why people are commenting bad about the cgi. ','featured',1,'2015-09-25 08:29:51',NULL,NULL,NULL),(16,9,58,'Akhil Theatrical Trailer || Akhil Akkineni, Sayyeshaa Saigal || VV Vinayak , Nithin','https://www.youtube.com/watch?v=jXXz-Jo9cu8','default.jpg','Watch: Akhil Theatrical Trailer, Starring Akhil Akkineni, Sayyeshaa Saigal in lead roles, Anup Rubens & S. Thaman together composed the music. Written by Veligonda Srinivas and Directed by VV Vinayak, Produced jointly by actor Nithiin and his father Sudhakar Reddy on Sreshth Movies banner. Stay tuned to Sreshth ','normal',1,'2015-09-25 08:31:25',NULL,NULL,NULL),(17,9,60,'Srimanthudu Full Songs Jukebox || Mahesh Babu, Shruthi Hasan, Devi Sri Prasad ','https://www.youtube.com/watch?v=4kYfcwZCbiw','default.jpg','Listen & Enjoy Srimanthudu Songs Jukebox Starring Mahesh Babu, Shruthi Hasan,Music Composed by Devi Sri Prasad,Directed by Koratala Siva,Produced by Y.Naveen, Y.Ravi,C.V. Mohan Under the Banner of Mythri Movie Makers.','featured',1,'2015-09-25 09:27:20',NULL,NULL,NULL),(18,9,60,' Dheere Dheere Se Meri Zindagi Video Song (OFFICIAL) Hrithik Roshan, Sonam Kapoor | Yo Yo Honey Singh','https://www.youtube.com/watch?v=nCD2hj6zJEc','default.jpg','In Loving Memory of Shri GULSHAN KUMAR, we present to you Bhushan Kumar\'s \"Dheere Dheere Se Meri Zindagi\" Song recreated by YO YO HONEY SINGH directed by Ahmed Khan featuring HRITHIK ROSHAN & SONAM KAPOOR exclusively on T-Series.\r\nClick to share it on FB: http://bit.ly/DheereDh','normal',1,'2015-09-25 09:28:55',NULL,NULL,NULL),(19,9,62,'20 Perfectly Timed Sports Photos ','https://www.youtube.com/watch?v=QeXXImhgXFo','default.jpg','Electro Cabello\" Kevin MacLeod (incompetech.com)\r\nLicensed under Creative Commons: By Attribution 3.0','featured',1,'2015-09-25 09:30:58',NULL,NULL,NULL);

